import { useState } from "react";

function App() {
  let [s, setS] = useState([]);
  const [posts, setPosts] = useState([]);
  return (
    <div>
      <Container s={s} setS={setS} posts={posts} setPosts={setPosts} />
    </div>
  );
}

export default App;
